"""The labels are then written in a text file after the annotations have been processed. Compared to XML, a text file is simpler to read.

This code imports the **argparse** module, the **ElementTree** module from the **xml **package, and the **os** module. It also defines an argument parser using the **argparse** module to allow command-line arguments to be passed to the script.

The sets variable is a list of tuples containing the year and split name for the PASCAL VOC dataset. This variable is used later in the script to loop over each dataset split.

The classes_num variable is a dictionary that maps class names to class IDs. Each class name corresponds to a specific object category in the PASCAL VOC dataset, and is assigned a unique integer ID for use in machine learning models.

The **convert_annotation** function takes three arguments: **year, image_id, and f**. This function is responsible for converting the XML annotations for a single image into a format that can be used for machine learning. Specifically, it extracts the bounding box coordinates and class ID for each object in the image, and writes this information to a file in the format expected by the machine learning model.

Overall, this code sets up some important variables and functions needed for processing the PASCAL VOC dataset, which will be used later in the script to create annotations for training and testing machine learning models.
"""

import argparse
import xml.etree.ElementTree as ET
import os

parser = argparse.ArgumentParser(description='Build Annotations.')
parser.add_argument('dir', default='..', help='Annotations.')

sets = [('2007', 'train'), ('2007', 'val'), ('2007', 'test')]

classes_num = {'aeroplane': 0, 'bicycle': 1, 'bird': 2, 'boat': 3, 'bottle': 4, 'bus': 5,
               'car': 6, 'cat': 7, 'chair': 8, 'cow': 9, 'diningtable': 10, 'dog': 11,
               'horse': 12, 'motorbike': 13, 'person': 14, 'pottedplant': 15, 'sheep': 16,
               'sofa': 17, 'train': 18, 'tvmonitor': 19}


def convert_annotation(year, image_id, f):
    in_file = os.path.join('VOCdevkit/VOC%s/Annotations/%s.xml' % (year, image_id))
    tree = ET.parse(in_file)
    root = tree.getroot()

    for obj in root.iter('object'):
        difficult = obj.find('difficult').text
        cls = obj.find('name').text
        classes = list(classes_num.keys())
        if cls not in classes or int(difficult) == 1:
            continue
        cls_id = classes.index(cls)
        xmlbox = obj.find('bndbox')
        b = (int(xmlbox.find('xmin').text), int(xmlbox.find('ymin').text),
             int(xmlbox.find('xmax').text), int(xmlbox.find('ymax').text))
        f.write(' ' + ','.join([str(a) for a in b]) + ',' + str(cls_id))



