"""Next, I'm including a method to get the input and output ready. A (448, 448, 3) picture is the input, while a (7, 7, 30) tensor is the output. This is based on S x S x (B * 5 +C) to produce the output.

The number of grids is S X S. The number of bounding boxes in each grid is B. The number of predictions in each grid is C.
"""



"""The cv2 module in Python is a computer vision library built on top of the OpenCV library, which is a popular library for real-time computer vision and image processing. The import cv2 as cv statement imports the cv2 module and gives it the alias cv to make it easier to reference in the code.

Note that cv2 is not a built-in Python module, so it needs to be installed separately, usually through a package manager like pip.

This is a function called** read() **that takes in two arguments: image_path and label. The purpose of this function is to read in an image and its corresponding label information and prepare them for use in a YOLOv1 model. Here's a breakdown of what the function does:

1. Reads in an image using **cv.imread()** and converts it from BGR to RGB using **cv.cvtColor()**.

2. Resizes the image to (448, 448) using **cv.resize() **and normalizes it by dividing every pixel value by 255.

3. Initializes an empty numpy array called **label_matrix** with shape (7, 7, 30). This is the output of the function that will be used as the ground truth label for the YOLOv1 model.

4. Loops over each object in the label and extracts the object's class, xmin, ymin, xmax, and ymax values.

5. Calculates the center poin**t (x, y), width w, and height h** of the bounding box and converts them to their corresponding values within the 7x7 grid.

6. Uses the center point (x, y) to determine which grid cell the object belongs to, and sets the corresponding values in the label_matrix. The output label_matrix contains the following information for each grid cell:

* The confidence score for an object being present (**label_matrix[i, j, 24]).**

* The class probabilities **(label_matrix[i, j, 0:20]).**

* The bounding box coordinates **(label_matrix[i, j, 20:24]).**
"""

import cv2 as cv
import numpy as np

def read(image_path, label):
    image = cv.imread(image_path)
    image = cv.cvtColor(image, cv.COLOR_BGR2RGB)
    image_h, image_w = image.shape[0:2]
    image = cv.resize(image, (448, 448))
    image = image / 255.

    label_matrix = np.zeros([7, 7, 30])
    for l in label:
        l = l.split(',')
        l = np.array(l, dtype=np.int)
        xmin = l[0]
        ymin = l[1]
        xmax = l[2]
        ymax = l[3]
        cls = l[4]
        x = (xmin + xmax) / 2 / image_w
        y = (ymin + ymax) / 2 / image_h
        w = (xmax - xmin) / image_w
        h = (ymax - ymin) / image_h
        loc = [7 * x, 7 * y]
        loc_i = int(loc[1])
        loc_j = int(loc[0])
        y = loc[1] - loc_i
        x = loc[0] - loc_j

        if label_matrix[loc_i, loc_j, 24] == 0:
            label_matrix[loc_i, loc_j, cls] = 1
            label_matrix[loc_i, loc_j, 20:24] = [x, y, w, h]
            label_matrix[loc_i, loc_j, 24] = 1  # response

    return image, label_matrix

"""**Training the model**

Next, I am defining a custom generator that returns a batch of input and outputs.

This is a custom data generator class that inherits from keras.utils.Sequence and overrides its methods __init__, __len__, and __getitem__. The purpose of a data generator is to load data in batches during training to prevent memory overflow.

The __init__ method takes in the images, labels, and batch_size as arguments and initializes them as instance variables.

The __len__ method returns the number of batches in the dataset by dividing the total number of samples by the batch size and taking the ceiling of the result.

The __getitem__ method loads a batch of images and their corresponding labels. It retrieves the image paths and labels for the batch based on the batch index. Then, for each image in the batch, it calls the read function to preprocess the image and label into the format expected by the YOLO model. Finally, it returns a tuple of numpy arrays containing the batch of preprocessed images and their corresponding labels.
"""

from tensorflow import keras

class My_Custom_Generator(keras.utils.Sequence) :
  
  def __init__(self, images, labels, batch_size) :
    self.images = images
    self.labels = labels
    self.batch_size = batch_size
    
    
  def __len__(self) :
    return (np.ceil(len(self.images) / float(self.batch_size))).astype(np.int)
  
  
  def __getitem__(self, idx) :
    batch_x = self.images[idx * self.batch_size : (idx+1) * self.batch_size]
    batch_y = self.labels[idx * self.batch_size : (idx+1) * self.batch_size]

    train_image = []
    train_label = []

    for i in range(0, len(batch_x)):
      img_path = batch_x[i]
      label = batch_y[i]
      image, label_matrix = read(img_path, label)
      train_image.append(image)
      train_label.append(label_matrix)
    return np.array(train_image), np.array(train_label)

