"""##**Define a custom Output layer**

We need to reshape the output from the model so we define a custom Keras layer for it.

This is a custom Keras layer that reshapes the output tensor of a YOLO model to the desired shape. The YOLO model outputs a tensor of shape (batch_size, grid_size * grid_size * (num_classes + 5 * num_boxes)), where num_boxes is the number of bounding boxes predicted per grid cell, and the last dimension contains the class probabilities, the confidence scores, and the bounding box coordinates.

This layer takes this output tensor as input and reshapes it to (batch_size, grid_size, grid_size, num_boxes, 5 + num_classes), where each cell in the grid predicts num_boxes bounding boxes, and each bounding box is represented by 5 values (the confidence score, the x, y, width, and height of the box) and a vector of class probabilities of length num_classes. The confidence scores are sigmoid-transformed and represent the probability that there is an object in the corresponding grid cell. The x, y, width, and height coordinates of the bounding boxes are also sigmoid-transformed and relative to the size of the grid cell. The class probabilities are softmax-transformed and represent the probability that the object belongs to each class.
"""

from tensorflow import keras
import keras.backend as K

class Yolo_Reshape(tf.keras.layers.Layer):
  def __init__(self, target_shape):
    super(Yolo_Reshape, self).__init__()
    self.target_shape = tuple(target_shape)

  def get_config(self):
    config = super().get_config().copy()
    config.update({
        'target_shape': self.target_shape
    })
    return config

  def call(self, input):
    # grids 7x7
    S = [self.target_shape[0], self.target_shape[1]]
    # classes
    C = 20
    # no of bounding boxes per grid
    B = 2

    idx1 = S[0] * S[1] * C
    idx2 = idx1 + S[0] * S[1] * B
    
    # class probabilities
    class_probs = K.reshape(input[:, :idx1], (K.shape(input)[0],) + tuple([S[0], S[1], C]))
    class_probs = K.softmax(class_probs)

    #confidence
    confs = K.reshape(input[:, idx1:idx2], (K.shape(input)[0],) + tuple([S[0], S[1], B]))
    confs = K.sigmoid(confs)

    # boxes
    boxes = K.reshape(input[:, idx2:], (K.shape(input)[0],) + tuple([S[0], S[1], B * 4]))
    boxes = K.sigmoid(boxes)

    outputs = K.concatenate([class_probs, confs, boxes])
    return outputs



